import React from "react";
const CourseTableHead = () => {
  return (
    <thead>
      <tr>
        <th>Course Name</th>
        <th>Date</th>
        <th>Credits</th>
        <th>Button</th>
      </tr>
    </thead>
  );
};

export default CourseTableHead;
